mutation containerIpAddressRangeAddValues ( $ipAddressRangeContainerAddValuesInput:IpAddressRangeContainerAddValuesInput! ) {
	container ( ) {
		ipAddressRange {
			addValuesIpAddressRangeContainerMutations: addValues ( input:$ipAddressRangeContainerAddValuesInput   ) {
				containerIpAddressRangeContainerAddValuesPayload: container {
					id
					name
					description
					size
					auditIpAddressRangeContainer: audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
				}

			}
		}

	}	
}
